import React, { Component } from "react";
import Question from "../components/Question.js";

class Deets extends Component {
  state = {};
  render() {
    return (
      <div>
        Deets Component Here
          {this.props.game.questions ? 
          this.props.game.questions.map(question => <Question key={question.id} question={question} handleClick={this.props.handleClick} />
          ) : null
        }
      </div>
    );
  }
}

export default Deets;
